# Parameters
depth_multiple: 1.  # model depth multiple
width_multiple: 1.  # layer channel multiple
depth_layer: [C3]
width_layer: [Conv, C3, SPPF, Detect]
anchors:
#  - [8,15, 18,30, 25,15]  # P3/8
#  - [32,61, 62,45, 59,119]  # P4/16
#  - [116,90, 156,198, 373,326]  # P5/32
  - [2,3, 6,9, 4,7]
  - [5,12, 8,15, 12,20]
  - [ 25,15, 28,34, 19,33]


# [from,  module, args], args=[ch_in , ch_out, etc]
backbone:
  [[-1, Conv, [32, 3, 6, 2]],  # 0
   [-1, C3, [32, 32, 1]],
   [-1, Conv, [32, 64, 3, 1]],
   [-1, C3, [64, 64, 1]],
   [-1, Conv, [64, 128, 3, 2]],  # 4-P1/4
   [-1, C3, [128, 128, 3]],
   [-1, Conv, [128, 256, 3, 2]],  # 6-P2/8
   [-1, C3, [256, 256, 3]],
   [-1, Conv, [256, 512, 3, 2]],  # 8-P3/16
   [-1, C3, [512, 512, 3]],
   [-1, SPPF, [512, 512, 5]],  # 10
  ]

neck:
  [[-1, Conv, [512, 512, 1, 1]],
   [-1, C3, [512, 512, 3, False]],  # 12 (P5/16-big)

   [-1, Conv, [512, 512, 1, 1]],
   [[-1, 7], Upsample_Concat,  [1, 'nearest']],  # cat backbone P4/8-medium
   [-1, C3, [512, 256, 3,  False]], #15

   [-1, Conv, [256, 256, 1, 1]],
   [[-1, 5], Upsample_Concat,  [1, 'nearest']],  # cat head P5
   [-1, C3, [256, 128, 3, False]],  # 18 (P3/4-small)
  ]

head:
  [[[18, 15, 12], Detect, [[128, 256,512], nc, anchors]], # Detect(P3, P4, P5)
  ]

